    "land-cover-classification-and-other-data-from-unknown-from-19720101-to-19721231-ncei-accession",nt"isopen":
    false,nt"url": null,nt"notes": "This project was undertaken in order to
    gain an overview of the present plans, projects and information base for Delaware
    Bay with a view to planning and possible future regulation by the Delaware River
    Basin Commission. It was carried out by the University of Delaware under contract
    to the Basin Commission with Sea Grant funding matched with a baseline study planning
    grant from the National Geographic Society.nnThe geographic area covered by the
    the study is Delaware Bay and its immediate environs. Delaware Bay is taken to be
    the water area bounded by New Jersey and Delaware and extending from a line between
    Capes Henlopen and May up to Liston Point. Of necessity, the report also concerns
    itself with the contiguous shore areas and other areas exerting, or likely to exert,
    a major influence on the bay.nnThe study was divided into two major portions: a
    sociopolitical one, and an engineering and scientific one. The sociopolitical portion
    of the study was subcontracted to the Natural ad Historical Resource Associates,
    who were given access to relevant portions of the unpublished report of the Delaware
    Governor's Task Force in Coastal and Marine Affairs as well as certain supporting
    materials. These materials had been prepared by Sate and University of Delaware
    personnel in response to requests by the Task Force",nt"license_title": null,nt"extras":
